import React from "react";
import ExpenseItem from "./ExpenseItem";

function ExpensesList(props){
    {props.items.length===0?<p>No Expenses Found</p> :
    props.items.map((item,index)=>
       <ExpenseItem
       key={index}
       title={item.title}
       amount={item.amount}
       date={item.date}
     />
     )};
return <ul cl>

</ul>
}
export default ExpensesList;
